<article className="vh-100 dt w-100 bg-orange">
<div className="dtc v-mid tc white ph3 ph4-l">
<h1 className="f6 f2-m f-subheadline-l fw6 tc">
<img src={logo} alt='C.R.I Fluid Systems' />
</h1>
</div>
</article>

</div>

);  //return ends here
